import React from 'react'
import { Box, Button, Card, CardMedia, Grid, Paper, Typography } from '@mui/material'
import { Stack } from '@mui/system'
import payRent from '../../Assets/Images/payRent.svg'

import { makeStyles } from '@material-ui/styles';

const useStyle = makeStyles({
    mainBox: {
        padding:'48px 0 28px',
        maxWidth:'1056px',
        margin:'0 auto'

    },
    imageBox:{
        height:'48px',
        width:'48px',
        opacity:1,
        borderRadius:'25px'
    }

    

    })
const HomeCard = () => {
    const cardHome = useStyle();
  return (
    <Box className={cardHome.mainBox}>
        <Stack direction='row' spacing={2}> 
         <Typography variant='h6' component='div' fontWeight={600}>
            Bahria Housing Porject
         </Typography>
         <Button variant="outlined" size='small' >
            Explore All
         </Button>
        </Stack>

           {/* card section */}
           <Stack direction='row' spacing='0' mt={2} p={2}>
            <Paper >
                <Box className={cardHome.imageBox} p={2}>
                                <CardMedia 
                                component="img"
                                image={payRent}
                                height='100%'
                                
                                />
                </Box>
            </Paper>

           </Stack>

           
       
    </Box>
  )
}

export default HomeCard
